// You can edit from here
let fields = {};

let displayInterval;

/**
Increase or decrease this value 
to speed up or down the global animations timing
**/
const TIMING = 1;

const app = document.getElementById('app');
const container = document.getElementById('container');
const content = document.getElementById('content');
const iconContainer = document.getElementById('icon-container');
const title = document.getElementById('title');
const info = document.getElementById('info');
const discordIconSvg = document.getElementById('discord_icon_svg');
const twitterIconSvg = document.getElementById('twitter_icon_svg');
const InstaIconSvg = document.getElementById('instagram_icon_svg');
const YoutubeIconSvg = document.getElementById('youtube_icon_svg');
const FacebookIconSvg = document.getElementById('facebook_icon_svg');
const TiktokIconSvg = document.getElementById('tiktok_icon_svg');

const borderRules = [
  document.getElementById('border-top'),
  document.getElementById('border-bottom'),
];

function isModeratorOrBroadcaster(badges) {
  return !!badges.find(
    (badge) => badge.type === 'broadcaster' || badge.type === 'moderator',
  );
}

async function getOpeningTimeline(fontColor) {
  return (
    gsap
      .timeline()
      .set(borderRules, { backgroundColor: fontColor })
      .set(borderRules, { scaleX: 0 })
      .set(container, { backgroundColor: 'transparent', border: `2px transparent solid`})
      .set(all, { backgroundColor: 'transparent', border: `2px transparent solid`})
      .set(container, {backgroundColor: fields.primaryColor, border: `2px ${fields.fontColor} solid`})
      .set(all, {backgroundColor: fields.secondaryColor, border: `2px ${fields.fontColor} solid`})
      // borders
      .to(borderRules, { scaleX: 1 }, TIMING * 0.5)
      // slide container
      .to(all, { opacity: 1, duration: TIMING * 0.5 }, TIMING * 0.25)
  );

}

async function getDisplayContentTimeline(isFirst = false) {
  const splitTitle = new SplitText(title, { type: 'words,chars' });
  const splitInfo = new SplitText(info, { type: 'words,chars' });

  const staggerTitle = (TIMING * 0.3) / splitTitle.chars.length;
  const staggerInfo = (TIMING * 0.5) / splitInfo.chars.length;

  return Promise.all([
    gsap.timeline().set(content, { clearProps: 'all' }),

    // title
    gsap
      .timeline()
      .set(splitTitle.chars, {
        opacity: isFirst ? 0 : 1,
        y: isFirst ? 0 : -250,
      })
      .to(
        splitTitle.chars,
        {
          duration: TIMING * 0.3,
          stagger: staggerTitle,
          y: 10,
        },
        isFirst ? TIMING * 0.6 : 0,
      )
      .to(
        splitTitle.chars,
        {
          duration: TIMING * 0.3,
          stagger: staggerTitle,
          y: 0,
          ease: 'sine.out',
        },
        isFirst ? TIMING * 0.9 : TIMING * 0.3,
      )
      .to(
        splitTitle.chars,
        { opacity: 1, stagger: staggerTitle, ease: 'sine.inOut' },
        TIMING * 1.2 * 0.6,
      ),

    //content
    gsap
      .timeline()
      .set(splitInfo.chars, { opacity: 0, yPercent: 50 })
      .to(splitInfo.chars, {
        opacity: 1,
        yPercent: 0,
        stagger: staggerInfo,
        delay: isFirst ? TIMING * 1 : 0.5,
      }),
  ]);
}

async function wait(duration) {
  return new Promise((resolve) => setTimeout(resolve, duration));
}

let NETWORKS = [];

let hasOngoingAnimation = false;
let initialized = false;

async function startAnimation() {
  if (initialized && !hasOngoingAnimation) {
    hasOngoingAnimation = true;

    await Promise.all([
      gsap.set(app, {
        clearProps: 'all',
      }),
      gsap.set(content, {
        clearProps: 'all',
      }),
      gsap.set(container, {
        clearProps: 'all',
      }),
      gsap.set(borderRules, {
        clearProps: 'all',
      }),
    ]);
    for (let i = 0; i < NETWORKS.length; i++) {
      const network = NETWORKS[i];

      title.innerText = network.name;
      info.innerText = network.renderContent();

      if (i === 0) {
        const svg = network.icon.cloneNode(true);
        svg.classList.remove('hidden');
        svg.classList.add(network.iconClass);
        iconContainer.appendChild(svg);
        await Promise.all([
          getOpeningTimeline(fields.fontColor, TIMING),
          gsap
            .timeline()
            .set('path', { drawSVG: 0 })
            .to('path', { drawSVG: '100%', duration: TIMING * 0.4 }, 0),
          getDisplayContentTimeline(true),
        ]);
      } else {
        await getDisplayContentTimeline();
      }

      await wait(fields.idleDuration * 1000);

      if (i !== NETWORKS.length - 1) {
        await gsap
          .timeline()
          .to(content, { yPercent: 250, duration: TIMING * 0.25 }, 0)
          .set(content, { opacity: 0 })
          .to(
            iconContainer,
            { yPercent: 25, ease: 'power4.in', duration: TIMING * 0.25 },
            0,
          )
          .add(() => {
            const nextNetwork = NETWORKS[i + 1];
            const nextSVG = nextNetwork.icon.cloneNode(true);
            nextSVG.classList.remove('hidden');
            iconContainer.innerHTML = '';
            iconContainer.appendChild(nextSVG);
          })
          .to(iconContainer, {
            yPercent: 0,
            ease: 'power4.out',
            duration: TIMING * 0.25,
          });
      } else {
        await Promise.all([
          gsap.timeline().to(all, { opacity: 0 }),
          gsap.timeline().to(content, { opacity: 0 }),
        ]);
        iconContainer.innerHTML = '';
      }
    }
    if (fields.rotationInterval !== -1 && displayInterval) {
      clearTimeout(displayInterval);
      hasOngoingAnimation = false;
      displayInterval = setTimeout(
        startAnimation,
        fields.rotationInterval * 1000 * 60,
      );
    }
  }
}

window.addEventListener('onWidgetLoad', async function (obj) {
  fields = obj.detail.fieldData;
CustomEase.create(
  'custom',
  'M0,0,C0.204,0.098,0.202,1,0.5,1,0.8,1,0.802,0.098,1,0',
);
  document.body.style.color = fields.fontColor;

  NETWORKS = [
    fields.order1,
    fields.order2,
    fields.order3,
    fields.order4,
    fields.order5,
    fields.order6,
  ]
    .filter((item) => !!item)
    .map((sn) => {
      switch (sn) {
        case 'DISCORD':
          return {
            name: 'DISCORD',
            icon: discordIconSvg,
            iconClass: 'discord-logo',
            content: fields.discordName,
            renderContent() {
              return `${this.content}`;
            },
          };
        case 'TWITTER':
          return {
            name: 'TWITTER',
            icon: twitterIconSvg,
            iconClass: 'twitter-logo',
            content: fields.twitterName,
            renderContent() {
              return `${this.content}`;
            },
          };
        case 'INSTAGRAM':
          return {
            name: 'INSTAGRAM',
            icon: InstaIconSvg,
            iconClass: 'instagram-logo',
            content: fields.instagramName,
            renderContent() {
              return `${this.content}`;
            },
          };
        case 'YOUTUBE':
          return {
            name: 'YOUTUBE',
            icon: YoutubeIconSvg,
            iconClass: 'youtube-logo',
            content: fields.youtubeName,
            renderContent() {
              return `${this.content}`;
            },
          };
        case 'FACEBOOK':
          return {
            name: 'FACEBOOK',
            icon: FacebookIconSvg,
            iconClass: 'facebook-logo',
            content: fields.facebookName,
            renderContent() {
              return `${this.content}`;
            },
          };
        case 'TIKTOK':
          return {
            name: 'TIKTOK',
            icon: TiktokIconSvg,
            iconClass: 'tiktok-logo',
            content: fields.tiktokName,
            renderContent() {
              return `${this.content}`;
            },
          };
      }
    });

  initialized = true;

  if (fields.displayOnLoad) {
    startAnimation();
  }

  if (fields.rotationInterval !== -1) {
    displayInterval = setTimeout(
      startAnimation,
      fields.rotationInterval * 1000 * 60,
    );
  }
});
